// authentication.js
import axios from 'axios';
import { GET_ERRORS } from './types';


export const createPetProfile = (pet, history) => dispatch => {
	axios.post('/api/createpet', pet).then(res => {
		const { pet } = res.data
		if (pet) {
			console.log('created, now push')
		}
	})
	.catch(err => {
		dispatch({
			type: GET_ERRORS
		});
	});
}
